import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
// import { SQLiteProvider } from 'react-sqlite-hook'; // Import from your SQLite library
import App from './App'; // Replace with the actual path to your App component
import { Provider } from 'react-redux';

ReactDOM.render(
  <React.StrictMode>
    <Provider>
    <Router>
      {/* <SQLiteProvider databaseName="your-database-name" version="1.0"> */}
        <App />
      {/* </SQLiteProvider> */}
    </Router>
    </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);
